- input: "TEXT\x1CC00351379\x1CTEXT1\x1C\x1CF3A\x1CIn regards to letter dated September
    4, 2008 from Christopher A. Whyrick.  We have made corrections to the ECTD Totals
    for (1) Bhupen Amin and (2) American Pilot's Association PAC.  Regarding (1) Bhupen
    Amin, the ECTD totals (currently at $552.00) are short $500 from the totals which
    the FEC states they should be ($1052.00).  This is due to our campaign issuing
    a refund of Mr. Amin's $500.00 contribution dated 12/6/07.  That $500 contribution
    was refunded in the same period to Mr. Amin on 12/19/07.  Given that the $500.00
    contribution was refunded, the ECTD total of $552.00 is correct.  Regarding (2)
    American Pilots Association PAC, there was a duplicate record entered for this
    PAC causing the ECTD totals to not be correctly reflected in the previous report.
    \ The records have been merged and the correct ECTD total is now reflected for
    the PAC in this report."
